import React from 'react';
import { Glide } from 'react-glide';


export default class Sli extends React.Component {
      render(){
        return (
          <React.Fragment>
            <Glide height={500} width={500}>
              <img src='https://tribunasuldeminas.com.br/wp-content/uploads/2018/08/turismo-rural-780x405.jpg' />
              <img src='https://tribunasuldeminas.com.br/wp-content/uploads/2018/08/turismo-rural-780x405.jpg' />
              <img src='https://tribunasuldeminas.com.br/wp-content/uploads/2018/08/turismo-rural-780x405.jpg' />
            </Glide>
          </React.Fragment>
        )
      }

}
